    [],nt"revision_timestamp": "2016-07-27T23:06:30.751660",nt"name": "washington-maritime-nwrc-initial-survey-instructions-for-winter-wildlife-survey",nt"isopen":
    false,nt"url": null,nt"notes": "Due to the logistical challenges of accessing
    this refuge during the winter months, information on nonbreeding species use of
    refuge islands is very limited. This effort will provide much needed baseline data
    on species distribution and abundance on refuge islands within Rosario Strait and
    the Strait of Juan de Fuca which supports the highest diversity and abundance of
    species. These islands were also selected because they are highly vulnerable to
    an oil spill given their location adjacent to the main shipping channel for Northern
    Puget Sound. Finally, this survey period provides information on the distribution
    of rare or potential nuisance species such as Stellar Sea Lions (Eumetopias jubatus),
    Elephant Seals (Mirounga angustirostris), and Canada Geese (Branta canadensis) that
    are more commonly observed in this area during the nonbreeding season.",nt"license_title":
